import React from "react";
import { TextContainer } from "./Styled";
import { ZombieHome, HealthyHome } from "../../svg-icons";
import ZombieHomeSvg from "../../svg-icons/ZombieHome.svg";

const Home = () => (
  <>
    <TextContainer>Zombies</TextContainer>
    <img src={ZombieHomeSvg} />
    <ZombieHome width="50" />
    <div>
      <HealthyHome width="50" />
    </div>
  </>
);

export default Home;
